import React from 'react';
import './Content.css';
import vid from './Image/vid3.mp4';
import vid1 from './Image/vid4.mp4';
import video from './Image/vid5.mp4';

const Content = () => {
  return ( 
    <div className='most'>
      <div className='grid-container'>
        {/* Main Content */}
        <div className='content'>
          <h2>Main Content</h2>
          <p>This is the main content area where your primary content will go.</p>
        </div>

        {/* Sidebar 1 - Information */}
        <div className='sidebar'>
          <h2>Information</h2>
          <video autoPlay muted loop className='sidebar-video'>
            <source src={vid} type="video/mp4" />
          </video>
          <p>This is a sidebar with additional information.</p>
        </div>

        {/* Sidebar 2 - Projects */}
        <div className='sidebar2'>
          <h2>Projects</h2>
          <video autoPlay muted loop className='sidebar-video'>
            <source src={vid1} type="video/mp4" />
          </video>
          <p>This is a sidebar with additional information. This is a sidebar with additional information...</p>
        </div>

        {/* Service Section */}
        <div className='content2'>
          <h2><b>Our Service</b></h2>
          <div className='paragraph'>
            <p><strong><b>We provide the best service as you want.</b></strong></p>
          </div>

          <video autoPlay muted loop className='service-video'>
            <source src={video} type="video/mp4" />
            Its working
          </video>
        </div>
      </div>
    </div>
  );
};

export default Content;
